import {Typography,AppBar,Button,Paper,ButtonGroup,Card,CardContent,CardMedia,CssBaseline,Grid,Toolbar,Container, CardActions} from '@material-ui/core'
import useStyles from '../styles'
import Cards from './Cards'
import Drawers from './Drawers'

const OfferScreen = () => {
    const classes = useStyles()
    const grids = [1,2,3,4,5,6]
    return (
        <>
        <Drawers/>
        <Grid container spacing={3} className={classes.mainGrid}> 
        {
            grids.map((grid)=>(
                <Grid item md={4} sm={6} xs={12} key={grid}>
                {/* <Cards/> */}
               </Grid>
                
            ))
        }
           
           
        </Grid>
      
        </>
    )
}

export default OfferScreen
